import React from 'react'
import '../Booking/booking.css';
import { Form, FormGroup, ListGroup, ListGroupItem, Button } from 'reactstrap';

const Booking = ({tour}) => {
  return (
    <>
      <div className="booking">
         <div className="booking__top d-flex "></div>
      </div>
    </>
  )
}

export default Booking
